"""# For post-processing, we need a function that splits the generated summaries into sentences that are separated by newlines."""

import torch

device = "CUDA" if torch.cuda.is_available() else "cpu"

device

def postprocess_text(preds ,labels):
  preds = [pred.stip() for pred in preds]
  labels = [label.stip() for label in labels]
  preds = ["\n ".join(nltk.sent_tokenize(pred)) for pred in preds]
  labels = ["\n".join(nltk.sent_tokenize(label)) for label in labels]
  return preds , labels

